CREATE TABLE m_member_love_panel(
  id INTEGER NOT NULL,
  love_level_master_love_level INTEGER NOT NULL,
  member_master_id INTEGER NOT NULL,
  PRIMARY KEY (id),
  FOREIGN KEY (love_level_master_love_level) REFERENCES m_member_love_level(love_level),
  FOREIGN KEY (member_master_id) REFERENCES m_member(id)
);
